import React from "react";

const Navbar = () => {
  const path = window.location.pathname;

  return (
    <div>
      <div
        style={{
          width: "100vw",
          display: "flex",
          gap: "40px",
          justifyContent: "flex-end",
          marginTop: "66px",
          alignItems: "center",
        }}
      >
        <p
          style={{
            fontSize: "25px",
            color: "#02B589",
            lineHeight: "23px",
            marginLeft: "-200px",
          }}
        >
          Хэрхэн ажилладаж вэ?
        </p>
        <button
          style={{
            display: `${path == "/Login" ? "none" : "flex"}`,
            marginRight: "123px",
            fontSize: "20px",
            borderRadius: "100px",
            width: "183px",
            height: "44px",
            backgroundColor: "#02B589",
            border: "none",
            color: "white",
          }}
        >
          Нэвтрэх
        </button>
      </div>
    </div>
  );
};
export default Navbar;
